import React, { createContext, useState } from 'react'
import axios from 'axios'



export const BreakContexte = createContext();

const BreakProvider = ({children}) => {
  const [name, setName] = useState('vvv')

  const fetchActeurs = async() => {
      try {
          const data = await axios.get('https://www.breakingbadapi.com/api/characters')
          console.log(data)
      } catch (error) {
          console.log(error)
      }  
  }
  return (
    <BreakContexte.Provider value={{name, setName, fetchActeurs}}>
        {children}
    </BreakContexte.Provider>
  )
}

export default BreakProvider
